;; ------- Credentials and Client---------
(def ak "")
(def sk "")

(def basic-cred (cred/basic-credentials ak sk))

(defn rekognition-client [cred]
  (AmazonRekognitionClient. cred))


;; ------ converter -------
(defn encode-base64
  "takes a byte array and encodes it to Base64 byte array"
  ([byte-array]
   (.encode (Base64/getEncoder) byte-array)))

(defn decode-base64
  "takes in a Base64 encoded byte array and returns a decoded byte array"
  ([byte-array]
   (.decode (Base64/getDecoder) byte-array)))

(defn bytearray-to-string
  "Converts a UTF-8 byte array to string"
  [byte-array]
  (apply str (map char byte-array)))

(defn string-to-bytearray
  "converts a string to UTF-8 Byte array"
  ([str]
   (.getBytes str "UTF-8")))

;; ----- Rekognition-------
(defn convert [img]
  (ByteBuffer/wrap (decode-base64 (string-to-bytearray img))))

(defn image [img]
  (->
    (Image.)
    (.withBytes (convert img))))

(defn compareFaceRequest [img1 img2]
  (->
    (CompareFacesRequest.)
    (.withSourceImage ,,, (image img1))
    (.withTargetImage ,,, (image img2))
    (.withSimilarityThreshold ,,, (float 70))))

(defn compareFaces [client cfR]
  (.compareFaces client cfR))

(defn face-detect-between-2-images [image1 image2]
  (compareFaces (rekognition-client basic-cred) (compareFaceRequest image1 image2)))

(defn getSimilarity [faceMatchResult]
  (let [matchResult (->>
                      (.getFaceMatches faceMatchResult)
                      (first ,,,))]
    (if (nil? matchResult)
      nil
      (.getSimilarity matchResult))))

(defn get-similarity-between-2-images [image1 image2]
  (getSimilarity (face-detect-between-2-images image1 image2)))

;; ----- Collection -----

(defn listCollectionRequest [max]
  (->
    (ListCollectionsRequest.)
    (.withMaxResults (Integer. max))))

(defn listCollections [max]
  (.listCollections (rekognition-client basic-cred) (listCollectionRequest max)))



;; ----- Create Collection -----

(defn split-on-slash [str]
  (second (clojure.string/split str #"/")))

(defn createCollectionRequest [collection-name]
  (try
    (->
      (CreateCollectionRequest.)
      (.withCollectionId ,,, collection-name))
    (catch Exception e
      (prn "caught " e))))

(defn createCollection [name]
  (try
    (split-on-slash (.getCollectionArn
                      (.createCollection
                        (rekognition-client basic-cred)
                        (createCollectionRequest name))))
    (catch Exception e
      (prn "caught" e))))

;; ------- Delete Collection -----

(defn deleteCollectionRequest [collection-name]
  (->
    (DeleteCollectionRequest.)
    (.withCollectionId ,,, collection-name)))

(defn deleteCollection [collection-name]
  (try
    (.getStatusCode (.deleteCollection (rekognition-client basic-cred) (deleteCollectionRequest collection-name)))
    (catch Exception e
      (prn "caught" e)
      0)))

;; ----- Insert image in a collection ------

(defn indexFaceRequest [collection-name img]
  (->
    (IndexFacesRequest.)
    (.withCollectionId ,,, collection-name)
    (.withDetectionAttributes ,,, ["ALL"])
    (.withImage ,,, img)))

(defn indexFaces [collection-name img]
  (.indexFaces
    (rekognition-client basic-cred)
    (indexFaceRequest collection-name (image img))))

(defn get-id [faceRecord]
  (->>
    (.getFace faceRecord)
    (.getFaceId ,,,)))


(defn indexFaceRecords [collection-name img]
  (->>
    (indexFaces collection-name img)
    (.getFaceRecords ,,,)
    (map get-id ,,,)
    (into [] ,,,)))

;; ------ List Faces in a collection ------
(defn listFaceRequest [collection-name]
  (->
    (ListFacesRequest.)
    (.withCollectionId collection-name)))

(defn listFaces [collection-name]
  (.listFaces (rekognition-client basic-cred) (listFaceRequest collection-name)))

(defn getFaceid [face]
  (.getFaceId face))

(defn listIndexesInCollection [collection-name]
  (->>
    (listFaces collection-name)
    (.getFaces ,,,)
    (map getFaceid ,,,)
    (into [] ,,,)))


;; ------- Delete Face from collection ---------

(defn deleteFaceRequest [collection-id img-id-arr]
  (->
    (DeleteFacesRequest.)
    (.withCollectionId ,,, collection-id)
    (.withFaceIds ,,, img-id-arr)))

(defn deleteFaces [collection-id img-id-arr]
  (.getDeletedFaces
    (.deleteFaces
      (rekognition-client basic-cred)
      (deleteFaceRequest collection-id img-id-arr))))

;;-------- Search Face by Image ----------

(defn searchFaceByImageRequest [collection-name img max]
  (->
    (SearchFacesByImageRequest.)
    (.withCollectionId ,,, collection-name)
    (.withImage ,,, (image img))
    (.withMaxFaces (Integer. max))))

(defn searchFaceByImage [collection-name img max]
  (.searchFacesByImage (rekognition-client basic-cred) (searchFaceByImageRequest collection-name img max)))

(defn matches? [collection-name img max]
  (let [comparison-result (->
                            (searchFaceByImage collection-name img max)
                            (.getFaceMatches ,,,))]
    (if (empty? comparison-result)
      nil
      comparison-result)))

(defn get-similarity [comparison-result]
  (.getSimilarity comparison-result))

(defn similarity-list [collection-name img max]
  (try
    (let [comparison-result (matches? collection-name img max)]
      (if (nil? comparison-result)
        []
        (into [] (map get-similarity comparison-result))))
    (catch Exception e
      [])))

(defn insert-multi-images-collection [request]
  (prn "MULTI IMAGE INSERT")
  (let [collection-name (get-in request [:data :collection-name])
        images (get-in request [:data :images])
        response-mid (map (partial indexFaceRecords collection-name) images)
        response (into [] (flatten response-mid))]
    (prn response)
    {:code 201
     :response response}))

