;; ------ Detect Faces --------

(defn detectFaceRequst [img]
  (->
    (DetectFacesRequest.)
    (.withAttributes ,,, ["ALL"])
    (.withImage ,,, img)
    ))

(defn detectFaces [img]
  (.detectFaces (rekognition-client basic-cred) (detectFaceRequst (image img))))

(defn getEmotion [emotion]
  [(.getType emotion) (.getConfidence emotion)])

(defn getFaceAttr [face]
  {:gender [(.getValue (.getGender face)) (.getConfidence (.getGender face))]
   :emotions (into [] (map getEmotion (.getEmotions face)))})

(defn getFaceDetail [img]
  (let [face-detail (.getFaceDetails (detectFaces img))]
    (if (empty? face-detail)
      []
      (into [] (map getFaceAttr face-detail)))))




